    <script type="text/javascript">
        $(this).load(function (win) {
            OverrideVideoURLs(win);
        });

        function OverrideVideoURLs(win) {
            var window = win.target.location.href;
            var queryString = window.substring((window.indexOf("?args=") + 6), window.index);
            if (queryString != undefined && queryString != "") {
                var decryptedQueryString = atob(queryString);
                var data = $.parseJSON(decryptedQueryString);
                var SubToCompOvrVideoURL = data.STCV;
                var DocUploadOvrVideoURL = data.DUV;
                var DataEntryOvrVideoURL = data.DEV;

                if (SubToCompOvrVideoURL != undefined && SubToCompOvrVideoURL != "") {
                    $("a[title = 'Subscribe to Complio']")[0].href = SubToCompOvrVideoURL;
                    $($("h5:contains('Subscribe to Complio')").parent())[0].href = SubToCompOvrVideoURL;
                }
                if (DocUploadOvrVideoURL != undefined && DocUploadOvrVideoURL != "") {
                    $("a[title = 'Document Upload']")[0].href = DocUploadOvrVideoURL;
                    $($("h5:contains('Document Upload')").parent())[0].href = DocUploadOvrVideoURL;
                }

                if (DataEntryOvrVideoURL != undefined && DataEntryOvrVideoURL != "") {
                    $("a[title = 'Data Entry']")[0].href = DataEntryOvrVideoURL;
                    $($("h5:contains('Data Entry')").parent())[0].href = DataEntryOvrVideoURL;
                }
            }
        }

    </script>
